INSERT INTO `report_work_tab` VALUES (1,3,1485321480,'-rezon-','<p></p><p></p><ol><li>Koordinasi dengan <b>Kanal Store</b>, ada 2 pembelian hari ini. Remote Baofeng Android dan Bobo Z4. Status pick up ke booth.<br></li><li>Koordinasi dengan +62 877-7313-1483 untuk pembelian lampu <b>Led Strip 5050 rgb 2m di Bukalapak</b><br></li><li><b></b>Check Report event komunitas Masih Cocoklogi season 2, dimana JakVR menjadi salah 1 sponsor pemberian hadiah. Ada penurunan aktifitas event dikarenakan ada event dadakan yg dihadirkan. Menjadi evaluasi untuk event season 3.<br><a target=\"_blank\" rel=\"nofollow\" href=\"https://www.facebook.com/notes/masih-cocoklogi/event-masih-cocoklogi-ii/1220401688041093\">https://www.facebook.com/notes/masih-cocoklogi/event-masih-cocoklogi-ii/1220401688041093</a> <br></li><li>Lagi testingÂ applikasiÂ VRÂ yangÂ sudahÂ dicobaÂ danÂ diÂ uploadÂ diÂ fanspageÂ JakVR<br>Â <a target=\"_blank\" rel=\"nofollow\" href=\"https://www.facebook.com/Jakvrcom/videos/1403703892982451/\">https://www.facebook.com/Jakvrcom/videos/1403703892982451/</a></li></ol><p></p><p></p>','',1),(2,2,1485372660,'tes','<p>tessssssss</p>',NULL,2),(3,8,1485499260,'Daily Work','<p>Mencari Artikel Tambahan and Nothing found.</p><p>Untuk artikel VR player masih mencoba-coba dengan ponsel tanpa gyro dan masih di magic vr,go vr, ama google cardboard</p><p>Perjalanan masih panjang untuk artikel VR player app</p><p><br></p>',NULL,0),(4,4,1485500160,'kerja','<p>hari ini ngecekin barag yag unik</p><p>input barag jaknot</p><p>dan jaga booth</p>',NULL,0),(5,3,1485399600,'-rezon-','<p></p><ol><li>Komunikasi denganÂ +62 812-1273-9140 terkait pembelian VR untuk event pameran telkomsel<br></li><li>Merespon pertanyaan buyerÂ +62 812-5316-7214 terkait pembelian bobo z4Â </li><li>Melayani tanya jawabÂ +62 818-964-523 yg akhirnya memutuskan order FiiT 2n</li><li>MelayaniÂ +62 877-7313-1483 tentang pesanannya di Bukalapak</li></ol><p></p>',NULL,1),(6,3,1485486300,'-rezon-','<p></p><ol><li>Komunikasi lanjutan denganÂ +62 812-1273-9140, dengan hasil sementara 15 order dan 15 pinjam. Dengan catatan 15 barang pinjaman dibayar full. Apabila barang kembali dan tidak rusak maka dana yang full untuk 15 produk pinjaman dikembalikan.</li><li>Komunikasi dan koordinasi dengan Kanal Store</li><li>Announcement pemenang eventÂ <a target=\"_blank\" rel=\"nofollow\" href=\"https://www.facebook.com/groups/1143614532386476/permalink/1240804849334110/\">https://www.facebook.com/groups/1143614532386476/permalink/1240804849334110/</a> pemenangÂ ygÂ mendapatÂ VR : <br>Nama : Aries Ardianto <br>Alamat : Distro Patriot \r\n( Depan Pasar Turen )\r\njl. Panglima Sudirman. no . 51. \r\nTuren. Malang<br>No Telp : 081334544327\r\n\r\n<br></li></ol><p>TidakÂ keÂ boothÂ karenaÂ sedangÂ fluÂ berat...<br></p><p></p>',NULL,1),(7,8,1485600540,'~JunG','<p>Libur mencari artikel tambahan maupun artikel terkait cara memilih kacamata vr</p><p>Masih mencoba2 3D/2D menggunakan magic vr dan go vr (kesimpulan sementara lebih prefer go vr)</p><p>Amunisi bobo z4 dan non gyro hh</p>',NULL,1),(8,4,1485607560,'kerja','<p>hari ini ga ngapa ngapainn,</p><p>cuman nglayanin customer doang dan hari ini nggak nginput barang.</p><p>hari ini rame nya parah gila. ampe pusing nih pala liatin orang orang.</p>',NULL,0),(9,3,1485694260,'-rezon-','<p></p><ol><li>Komunikasi dengan kanal store</li><li>Komunikasi lanjutan dengan Affan, yang akhirnya mengambil 14 bobo z4 dan sewa 11 bobo z4. Selesai meeting pukul 03:00 shubuh</li></ol><p></p>',NULL,3),(10,3,1485694380,'-rezon-','<p>DI booth CL, tiba pukul 09:50</p>',NULL,1),(11,8,1485646200,'~JunG','<p>Libur ko</p>',NULL,0),(12,8,1485732600,'~JunG','<p>Masih libur di rumah malang</p>',NULL,1),(13,3,1485712920,'-rezon-','<p></p><ol><li>Upload video unboxing shinecon 4.0Â <a target=\"_blank\" rel=\"nofollow\" href=\"https://youtu.be/ciRNEdxnPE8\">https://youtu.be/ciRNEdxnPE8</a><br></li><li>Bikin artikelÂ <a target=\"_blank\" rel=\"nofollow\" href=\"http://jakvr.com/memilih-kacamata-vr-terbaik/\">http://jakvr.com/memilih-kacamata-vr-terbaik/</a></li></ol><p></p>',NULL,1),(14,8,1485844980,'~JunG','<p>1. edit artikel <a target=\"_blank\" rel=\"nofollow\" href=\"http://jakvr.com/unboxing-kacamata-octagon-luna-vr/\" title=\"Link: http://jakvr.com/unboxing-kacamata-octagon-luna-vr/\">http://jakvr.com/unboxing-kacamata-octagon-luna-vr/</a></p><p>2. edit tag artikel <a target=\"_blank\" rel=\"nofollow\" href=\"http://jakvr.com/review-fiit-vr-2s-3d-the-new-generation-of-fiit-vr-headset/\">http://jakvr.com/review-fiit-vr-2s-3d-the-new-generation-of-fiit-vr-headset/</a></p><p>3. bikin artikel <a href=\"http://jakvr.com/film-virtual-reality-masuk-oscar/\">http://jakvr.com/film-virtual-reality-masuk-oscar/</a>ï»¿<br></p>',NULL,3),(15,3,1485873300,'-rezon-','<p></p><ol><li>Edit artikelÂ <a target=\"_blank\" rel=\"nofollow\" href=\"http://jakvr.com/panduan-handphone-virtual-reality/\">http://jakvr.com/panduan-handphone-virtual-reality/</a></li><li>Koordinasi denganÂ KanalÂ Store<br></li><li>MenerimaÂ telpon dariÂ 081807821162Â yangÂ kemudianÂ berkunjungÂ keÂ boothÂ danÂ membeliÂ ShineconÂ VRÂ 4.0<br></li><li>Bikin listÂ pribadiÂ untukÂ daftarÂ produk JAKVRÂ ygÂ belumÂ adaÂ unboxingÂ danÂ reviewÂ diÂ youtube.<br></li><li>BikinÂ listÂ pribadi daftarÂ produkÂ untukÂ dropsip &Â resseller</li></ol><br><br><br><br><p></p>',NULL,1),(16,8,1485926760,'~JunG','<p>1. mencari artikel tambahan (nothing found) >>> minta bantuan kalo ada yang punya ide</p><p>2. masih berkutat dengan VR player app</p><p><br></p>',NULL,0),(17,4,1485928740,'masuk','<p>pesenan kanal store sudh di pick</p><p>yang jne dari rumah aja</p><p>tolong harga barang yag dari jaknot sgera di bikin</p>',NULL,0),(18,3,1485911460,'-rezon-','<p></p><ol><li>Lanjutan komunikasi denganÂ \r\n\r\nÂ 081807821162 Â untuk pembelian 3 shinecon 4.0 status order japri dan transfer ke rekening bca<br></li><li>Bikin video unboxing bobo z4 mini dan fiit vr 2n</li><li>Komunikasi dengan Kanal Store</li><li>Upload vide